import React from "react"
import Icon from "./icon"



function Header(props){
  return (
    <nav className="navigation-bar">
    <ul class="navigation-list"></ul>
      <Icon 
        typeIcon = "fas fa-user-plus"
        color = "#06ab00"
      />
      <Icon typeIcon = "fas fa-print"/>
      <ul />
    </nav>
    
  )
}

export default Header;
